const ExpensesList = () => {


let expensesContent = <p>No expenses found</p>

    

  if(filteredExpenses.length > 0) {
    expensesContent = filteredExpenses.map((expense) => (
      <ExpenseItem 
      key={expense.id}
      title={expense.title} 
      amount={expense.amount} 
      date={expense.date} />
    )) 
  }

return (
    <div>

    </div>
    )

}

export default ExpensesList
